description:
_ SALE 75% OFF! _
Tired of robocalls, telemarketers and other nuisance calls? Put their numbers in your own personal blocking list and their calls will be blocked! Our app provides you multiple easy yet powerful ways to build and manage your own list. Do not need call blocking? Turn off "Block calls" and you will get powerful and flexible personal Caller ID system.

Now call blocking and identification is as easy as 1-2-3.

_ Our features _
_ Clean simple yet powerful UI;
_ iOS and Phone app integration _ blocking and identifying incoming calls, recent calls identification support, number identification while typing;
_ Unwanted callers blocking;
_ Personal Caller ID;
_ Lots of easy and convenient ways to build your own personal blocking and identification list: chose from Contacts or enter manually;
_ [PRO version] Set multiple ranges of phone numbers (see description bellow);
_ [PRO version] Insert phone numbers from the Clipboard;
_ [PRO version] Import CSV files from other applications and cloud services _ Apple iCloud Drive, Google Drive, Microsoft OneDrive and others;
_ Dashboard with quick access to common functions;
_ Supports all iPhones running iOS 10 and later (including iPhone 5/5C).

_ IMPORTANT: How it works _
The app uses only numbers you put in the list to block and/or identify calls. "Block calls" works very similar to Decline button, you will NOT be notified about blocked calls, unless your carrier sends notifications about missed calls. Blocked caller still able to leave a voicemail, as it happens on carrier's side (contact your carrier for details). 

We have NO access to your call log, however please note _ iOS doesn't put blocked calls into call log.  

"Identify caller" adds labels from your list to Phone app for incoming calls, call log and "Keypad" tab. 

_ IMPORTANT: Private & Unknown calls _
Nor this app, nor any other app in the App Store, doesn't allow you to block or identify Private, Hidden or Unknown calls due to the way iOS call blocking and identification system works. We have described some workarounds in FAQ & Help section of our app.

_ IMPORTANT: Ranges of numbers _
iOS call blocking and identification system is limited to about 1.9 million numbers per app. This is (roughly) equal to 6 digits of number. Please note, only first 1.9 million numbers from your list (ordered ascending), including all numbers from the ranges in your list, will be used by iOS.
This limit DOESN'T allow you to block the WHOLE specific carrier, area code or country code.

_ Contact Us, Support & Feedback _
If you have any questions _ feel free to contact us. You can use "Contact Us" link in the app,  "App Support" link in the "Reviews" tab of the App Store or send us email on sergey.smirnov.dev@gmail.com. We are usualy responding within hours on every non-empty email.
If you have contacted us, but haven't recieved our reply _ check your Mail app, it's there. ;)

